An extension can be removed only if the storage is empty . The remove<Ext>(kiosk: &mut Kiosk, cap: &KioskOwnerCap) function can be used to remove an extension. It will remove the extension, unpack the extension storage and configuration and rebate the storage cost to the Kiosk Owner. Can only be performed by the Kiosk Owner. The call will fail if the storage is not empty. Example PTB let txb = new TransactionBuilder();
let kioskArg = tx.object('<ID>');
let capArg = tx.object('<ID>'); txb.moveCall({ target: '0x2::kiosk_extension::remove', arguments: [ kioskArg, capArg ], typeArguments: '<letter_box_package>::letterbox_ext::Extension'
});

