Sui Move has two main ways for authorizing an action: static - by using the Witness pattern, and dynamic - via the Capability pattern. With a small addition of type parameters to the Rule, it is possible to create a generic Rule which will not only vary by configuration but also by the type of the Rule. module examples::witness_rule { // skipping dependencies /// Rule is either not set or the Witness does not match the expectation const ERuleNotSet: u64 = 0; /// This Rule requires a witness of type W, see the implementation struct Rule<phantom W> has drop {} struct Config has store, drop {} /// No special arguments are required to set this Rule, but the /// publisher now needs to specify a Witness type public fun add<T, W>(/* .... */) { policy::add_rule(Rule<W> {}, policy, cap, Config {}) } /// To confirm the action, buyer needs to pass in a witness /// which should be acquired either by calling some function or /// integrated into a more specific hook of a marketplace / /// trading module public fun confirm<T, W>( _: W, policy: &TransferPolicy<T>, request: &mut TransferRequest<T> ) { assert!(policy::has_rule<T, Rule<W>>(policy), ERuleNotSet); policy::add_receipt(Rule<W> {}, request) }
} The "witness_rule" is very generic and can be used to require a custom Witness depending on the settings. It is a simple and yet a powerful way to link a custom marketplace / trading logic to the TransferPolicy. With a slight modification, the rule can be turned into a generic Capability requirement (basically any object, even a TransferPolicy for a different type or a TransferRequest - no limit to what could be done). module examples::capability_rule { // skipping dependencies /// Changing the type parameter name for better readability struct Rule<phantom Cap> has drop {} struct Config {} /// Absolutely identical to the witness setting public fun add<T, Cap>(/* ... *) { policy::add_rule(Rule<Cap> {}, policy, cap, Config {}) } /// Almost the same with the Witness requirement, only now we /// require a reference to the type. public fun confirm<T, Cap>( cap: &Cap, /* ... */ ) { assert!(policy::has_rule<T, Rule<Cap>>(policy), ERuleNotSet); policy::add_receipt(Rule<Cap> {}, request) }
}

