let kioskArg = tx.object('<ID>');
let capArg = tx.object('<ID>'); txb.moveCall({ target: '0x2::kiosk_extension::disable', arguments: [ kioskArg, capArg ], typeArguments: '<letter_box_package>::letterbox_ext::Extension'
});
